script: |
  super -f text -I q2685.spq | sort > q2685.out

inputs:
  - name: q2685.spq
    data: |
      SELECT * FROM tab1 (FORMAT parquet) WHERE NOT - col2 IN ( - + 0 * - - 41 * col0, + col1, - 26, + 43, 68 );
  - name: tab1

outputs:
  - name: q2685.out
    data: |
      51	14	96
      85	5	59
      91	47	68
